import Navbar from "./components/Navbar";
import User from "./components/User";
export default class App extends Component {
  state = {
    users: [
      {
        id: 1,
        name: "Nurcan",
        department: "Ceng",
        salary: "8000",
      },
      {
        id: 2,
        name: "Rabia",
        department: "Teach",
        salary: "10000",
      },
      {
        id: 3,
        name: "Ayşe",
        department: "Nurse",
        salary: "7000",
      },
    ],
  };

  render() {
    return (
      <div>
        <div className="container">
          <h2 className="header">Css denemesi</h2>
          <h1 style={{ color: "purple", fontSize: "30px" }}>App Component </h1>
          <h1 className="container">App Component </h1>
          <Navbar title="Props Başlık" />
          <Navbar />
          <User name="Nurcan" department="Bilgisayar Müh" salary="8000" />
          <User name="Mehmet" department="Bilgisayar Müh" salary="9000" />
          <User />
        </div>
      </div>
    );
  }
}
